import React from "react";
import Main from "./Main.js";
import Header from "./Header.js";
import Footer from "./Footer";
import PopupWithForm from "./PopupWithForm.js";
import ImagePopup from "./ImagePopup.js";

function App() {
  function handleEditAvatarClick(){
    const buttonEditAvatar = document.querySelector('.profile__photo-edit');
    const popupEditAvatar = document.querySelector('#popupEditAvatar');
    buttonEditAvatar.addEventListener('click', () => {
        popupEditAvatar.classList.add('popup_opend');
    })
  }
  function handleEditProfileClick(){
    const buttonEditProf = document.querySelector('.profile__change');
    buttonEditProf.addEventListener('click', () => {
      isEditProfilePopupOpen = true;
    })
  }
  function handleAddPlaceClick(){
    const buttonAddPlace = document.querySelector('.profile__add');
    const popupAddPlace = document.querySelector('#popupPlace');
    buttonAddPlace.addEventListener('click', () => {
        popupAddPlace.classList.add('popup_opend');
    })
  }
  let isEditProfilePopupOpen = false;
  let isAddPlacePopupOpen = false;
  let isEditAvatarPopupOpen = false;
  return (
    <div className="page">
    <Header />
    <Main onEditProfile={handleEditProfileClick} onAddPlace={handleAddPlaceClick} onEditAvatar={handleEditAvatarClick}/>
    <Footer />
    <PopupWithForm name="Prof" title ="Редактировать профиль" button="Сохранить" isOpen = {isEditProfilePopupOpen}>
      <input className="form__input" placeholder="Ваше Имя" id="form__name" name="name" required type="text" minLength="2" maxLength="40" />
      <span className="form__input-error form__name-error"></span>
      <input className="form__input" placeholder="Чем вы занимаетесь" id="form__about" name="about" required type="text" minLength="2" maxLength="200" />
      <span className="form__input-error form__about-error"></span>
    </PopupWithForm>
    <PopupWithForm name="Place" title ="Новое место" button="Создать">
      <input className="form__input" placeholder="Название" id="form__place" name="place" required type="text" minLength="2" maxLength="30"/>
      <span className="form__input-error form__place-error"></span>
      <input className="form__input" placeholder="Ссылка на картинку" id="form__link" name="link" required type="url"/>
      <span className="form__input-error form__link-error"></span>
    </PopupWithForm>
    <ImagePopup>
    </ImagePopup> 
    <PopupWithForm name="Delet" title="Вы уверены?" button="Да" />
    <PopupWithForm name="EditAvatar" title="Обновить аватар" button="Сохранить">
      <input className="form__input" placeholder="Ссылка на новый аватар" id="form__input" name="avatar" margin="0" required type="url" />
      <span className="form__input-error form__link-error"></span>
    </PopupWithForm>

    <template id="templateCard">
      <div className="element">
        <button className="element__img-popup">
          <img className="element__img" alt="close"/>
        </button>
        <button type="button" className="element__delete" id="deletButton"></button>
        <div className="element__name">
          <h2 className="element__paragraph">ef</h2>
          <div className="element__like-zone">
            <button type="button" className="element__like"></button>
            <span className="element__counter">0</span>
          </div>
        </div>
      </div>
    </template>
  </div>
  );
}

export default App;
